import React from "react";
import './css/Other.css';

export default function About() {
    return(
        <>
            <div className="title">UI Design</div>
            <div className="row">
                <img src="https://www.augustinaliu.com/wp-content/uploads/2019/12/Daily-UI-06.png" />
                <img src="https://www.augustinaliu.com/wp-content/uploads/2019/09/DAILY-UI-002-1.png" />
                <img src="https://www.augustinaliu.com/wp-content/uploads/2019/09/Frame-2.png" />
            </div>
        </>
    )
}
